(window.webpackJsonp=window.webpackJsonp||[]).push([[80],{663:function(n){n.exports={name:"navbar",displayName:"Navbar *导航栏*",group:"navigation",text:'\n提供一个页面级的水平布局导航栏组件。\n\n``` demo.abf25a62\nimport { Navbar, Icon, Menu, FlexibleSpace } from \'nami\'\n\nrender(\n    <Navbar>\n        <Navbar.Brand>\n            <a href="#">App</a>\n        </Navbar.Brand>\n\n        <Menu>\n            <Menu.Item>\n                <a href="#">首页</a>\n            </Menu.Item>\n            <Menu.Item>\n                <a href="#documents">文档</a>\n            </Menu.Item>\n            <Menu.Item>\n                <a href="#about">关于</a>\n            </Menu.Item>\n\n            <FlexibleSpace />\n\n            <Menu.Item>\n                v3.x\n                <Menu>\n                    <Menu.Item>\n                        <a href="#v2">v2.x</a>\n                    </Menu.Item>\n                    <Menu.Item>\n                        <a href="#v1">v1.x</a>\n                    </Menu.Item>\n                </Menu>\n            </Menu.Item>\n            <Menu.Item>\n                <a href="https://github.com/biossun/nami">\n                    <Icon name="github" />&nbsp;Github\n                </a>\n            </Menu.Item>\n        </Menu>\n    </Navbar>,\n    containerEl\n)\n```\n\n## 参数\n\n### Navbar\n\n| 参数       | 说明         | 类型                         | 默认值 |\n| ---------- | ------------ | ---------------------------- | ------ |\n| `children` | 导航栏内容项 | `Navbar.Brand` &#124; `Menu` |        |\n\n### Navbar.Brand\n\n| 参数       | 说明           | 类型                  | 默认值 |\n| ---------- | -------------- | --------------------- | ------ |\n| `children` | 标识文本或图像 | `string` &#124; `img` |        |\n',path:"./src/components/navbar/index.md",demos:{abf25a62:{name:"common"}}}}}]);